import React from 'react';
import ReactDOM from 'react-dom';
import Heading from './Heading ';

ReactDOM.render(
  <>
    <Heading />

    <ol>
      <li>Html</li>
      <li>CSS</li>
      <li>JavaScript</li>
      <li>ReactJs</li>
    </ol>
  </>,
  document.getElementById('root')
);
